export default {
  props: {
    tenantData: {
      type: Object,
      default: () => {
        return {}
      }
    }
  },
  data() {
    return {
      formLoading: false,
      dataForm: {},
      unitNatureList: [
        { fullName: '个体户', id: 0 },
        { fullName: '合伙企业', id: 1 },
        { fullName: '集体企业', id: 2 },
        { fullName: '私营企业', id: 3 },
        { fullName: '国有企业', id: 4 },
      ],
    }
  },
  computed: {
    unitNature() {
      let val = ''
      this.unitNatureList.forEach(o => {
        if (o.id === this.tenantData.unitInfoJson.unitNature) val = o.fullName
      })
      return val
    }
  },
  created() {
  },
  methods: {
  }
}
